import React from "react";
import logo from "./logo.svg";
import './App.css';
import { Login } from "./components/login/index"
class App extends React.Component{
  constructor(props){
    super(props);
    this.state={
      isLog: true,
    }

  }
  render() {
    const {isLog} = this.state;
    return (
      <div className="App">
          <div className="login">
              <div className="container">
                  {isLog && <Login/>}
              </div>
          </div>

      </div>
    )
  }
}

export default App;
